/****** SYSTEM REQUIREMENTS *****/
/****** SYSTEM REQUIREMENT 1 *****/
	/* There are 2 BMI160's giving data, The data MUST be */
	/* fused and estimated. The BMI160's are parallel to */
	/* each other. The rotation degree of both BMIs is 0 */
/****** END SYSTEM REQUIREMENTS *****/

/****** DEFINITION OF LIBRARIES *****/
#include <SPI.h>
#include <Adafruit_SensorLab.h> // https://github.com/adafruit/Adafruit_SensorLab
#include <DFRobot_BMI160.h> // https://github.com/DFRobot/DFRobot_BMI160

/****** FUNCTION PROTOTYPES *****/
void setup(void);
void loop(void);

/***** DEFINITION OF SPI PINS *****/
const uint8_t BMI160_PIN_MOSI_D23 = 23;
const uint8_t BMI160_PIN_MISO_D19 = 19;
const uint8_t BMI160_PIN_SCLK_D18 = 18;
const uint8_t BMI160_PIN_CS_D5 = 5;

/****** DEFINITION OF LIBRARIES CLASS INSTANCES *****/
Adafruit_SensorLab sensorLab; // Instance of the Adafruit Sensor Lab
DFRobot_BMI160 bmi160_1; // Instance of the first DFRobot BMI160
DFRobot_BMI160 bmi160_2; // Instance of the second DFRobot BMI160

void setup(void)
{
    // Initialize Serial communication
    Serial.begin(115200);
    delay(100);

    // Set the CS pin mode for the BMI160
    pinMode(BMI160_PIN_CS_D5, OUTPUT);

    // Start the SPI library
    SPI.begin();

    // Initialize the first BMI160 sensor
    if (bmi160_1.softReset() != BMI160_OK || bmi160_1.I2cInit(0x69) != BMI160_OK) {
        Serial.println("BMI160_1 Initialization failed");
        while (1); // Halt execution
    }

    // Initialize the second BMI160 sensor
    if (bmi160_2.softReset() != BMI160_OK || bmi160_2.I2cInit(0x68) != BMI160_OK) {
        Serial.println("BMI160_2 Initialization failed");
        while (1); // Halt execution
    }

    // Initialize the Adafruit Sensor Lab (assuming it has an init method)
    if (!sensorLab.begin()) {
        Serial.println("Sensor Lab Initialization failed");
        while (1); // Halt execution
    }
}

void loop(void)
{
    // Main code to run repeatedly
    int16_t accelGyro_1[6] = {0}; 
    int16_t accelGyro_2[6] = {0}; 

    // Read data from the first BMI160
    if (bmi160_1.getAccelGyroData(accelGyro_1) == 0) {
        // Read data from the second BMI160
        if (bmi160_2.getAccelGyroData(accelGyro_2) == 0) {
            // Fusion of data from both sensors
            for (int i = 0; i < 6; i++) {
                // Print the fused data
                if (i < 3) {
                    // Gyroscope data (in degrees)
                    Serial.print((accelGyro_1[i] + accelGyro_2[i]) * 3.14 / 180.0 / 2); // Average of gyroscope data
                } else {
                    // Accelerometer data (in g)
                    Serial.print((accelGyro_1[i] + accelGyro_2[i]) / 2 / 16384.0); // Average of accelerometer data
                }
                Serial.print("\t");
            }
            Serial.println();
        } else {
            Serial.println("Error reading BMI160_2 data");
        }
    } else {
        Serial.println("Error reading BMI160_1 data");
    }
    delay(100);
}

/* END CODE */
